import "./Experience.scss";

function Experience(prop) {
  return (
    <div className="experience">
      <h1>prop.title <span>@ Modumate</span></h1>
      <h2>May 2021 - August 2021</h2>
      <ul>
        <li>Worked as the only self-managed frontend engineer of the team</li>
        <li>
          Used Vue and Vuex to create new critical features for the product
          which directly affected 3000 enterprise users
        </li>
        <li>
          Helped collect engagement statistics for marketing by writing SQL
          queries and using Google Analytics
        </li>
      </ul>
    </div>
  );
}

export default Experience;
